import React, { Component } from 'react';
import Schedules from './Schedules';
import AvailableTimes from './components/AvailableTimes';
import Hospital from './components/Hospital';
import RedirectButton from './components/RedirectButton';

class App extends Component {      
    render() {
        let api_response;
        let schedules = [];

        // fetch all the schedules from the API
        fetch('https://api.inquicker.com/v2/schedules?api_key=b099b982537e880a747b472fe36ffe62148410eb')
        .then(resp => {
            return resp.json();
        })
        .then(results => {
        //
        api_response = results.data;

        api_response.map(obj => {
            let availTimes = [];
            obj.availableTimes[0].times.map(x => {
                    availTimes.push(x.time);
            });

            let schedule = {
                name: obj.location.name,
                availabletimes: availTimes,
            }

            schedules.push(schedule);
        });
        console.log(schedules);
        })
        .catch(error => console.log('error',error));



        return(
            <div>
                <div className="card">

                    <div className="card-title">
                        <Hospital />
                    </div>
                    <div>
                        {schedules.name}
                    </div>
                    <div className="card-body">
                        <AvailableTimes />
                        <RedirectButton />
                    </div>
                </div>
            </div>
        );
    };
}

export default App;
